import React from 'react'
import SocialItem from './SocialItem'

function Social(){
    return(
        <div>
        <ul className='list-group'>

            <SocialItem 
            p = {{
                media: 'Facebook', 
                id: 'facebook',
                img: 'https://picsum.photos/60',
            }}
            />
            
        </ul>
      </div>
    );
}

export default Social
